import React, { Component } from 'react';
import Layout from '../components/Layout';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import Divider from '@material-ui/core/Divider';
import ListItemText from '@material-ui/core/ListItemText';
import ListItemAvatar from '@material-ui/core/ListItemAvatar';
import Avatar from '@material-ui/core/Avatar';
import Typography from '@material-ui/core/Typography';
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';

const rootdiv = {
  width: '100%',
  maxWidth: 360,
  backgroundColor: "white",
  height: 450,
  overflow: 'auto',
//  display:'flex'

}
const colorlistitem={
 color: '#2a3747'

}
const gridList = {
 
   flexDirection: 'row',
    flexGrow: 1
   
  
}
const gridtotal = {
  width: '100%',
  maxWidth: 360,
  padding:4
}
const inline = {
  display: 'inline'
}
const paper ={
    padding:2,
    textAlign: 'center',
    color: "white",
  
}


class Caja extends Component {
   
  render() {

    return (
      <Layout>
       <Grid container spacing={8}>
        <Grid item>
        <List style={rootdiv}>
      <ListItem alignItems="flex-start">
        <ListItemAvatar>
          <Avatar alt="Remy Sharp">RS</Avatar>
        </ListItemAvatar>
        <ListItemText
        style={colorlistitem}
          primary="Brunch this weekend?"
          secondary={
            <React.Fragment>
              <Typography
                component="span"
                variant="body2"
                style={inline}
                color="textPrimary"
              >
                Ali Connors
              </Typography>
              {" — I'll be in your neighborhood doing errands this…"}
            </React.Fragment>
          }
        />
      </ListItem>
      <Divider variant="inset" component="li" />
      <ListItem alignItems="flex-start">
        <ListItemAvatar>
        <Avatar alt="Cindy Baker">CB</Avatar>
        
        </ListItemAvatar>
        <ListItemText
           style={colorlistitem}
          primary="Oui Oui"
          secondary={
            <React.Fragment>
              <Typography
                component="span"
                variant="body2"
                style={inline}
                color="textPrimary"
              >
                Sandra Adams
              </Typography>
              {' — Do you have Paris recommendations? Have you ever…'}
            </React.Fragment>
          }
        />
      </ListItem>
      <Divider variant="inset" component="li" />
      <ListItem alignItems="flex-start">
        <ListItemAvatar>
        <Avatar alt="Cindy Baker">CB</Avatar>
        
        </ListItemAvatar>
        <ListItemText
           style={colorlistitem}
          primary="Oui Oui"
          secondary={
            <React.Fragment>
              <Typography
                component="span"
                variant="body2"
                style={inline}
                color="textPrimary"
              >
                Sandra Adams
              </Typography>
              {' — Do you have Paris recommendations? Have you ever…'}
            </React.Fragment>
          }
        />
      </ListItem>
      <Divider variant="inset" component="li" />
      <ListItem alignItems="flex-start">
        <ListItemAvatar>
        <Avatar alt="Cindy Baker">CB</Avatar>
        
        </ListItemAvatar>
        <ListItemText
           style={colorlistitem}
          primary="Oui Oui"
          secondary={
            <React.Fragment>
              <Typography
                component="span"
                variant="body2"
                style={inline}
                color="textPrimary"
              >
                Sandra Adams
              </Typography>
              {' — Do you have Paris recommendations? Have you ever…'}
            </React.Fragment>
          }
        />
      </ListItem>

    </List>
    <Grid item xs={12} sm={6} style={gridtotal}>
          <Paper style={paper}>
ffgffff
          </Paper>
   </Grid>
   </Grid>
   <Grid item>
   <Paper style={paper}>
     
   </Paper>
   </Grid>
   </Grid>
      </Layout>
    );
  }
}

export default Caja;
